import React from "react";
import web from "../src/images/artboard.png";

const Home = () => {
  return (
    <>
      <div className="container-fluid align-items-center">
        <div className="row p-5">
          <div className="col-md-6 mx-auto ps-4 pt-5">
            <h1 className="pt-4">
              Grow your buisness with
              <span className="text-primary fw-bold pt-3">Satyam</span>
            </h1>
            <h5 className="pb-1">
              We are the team of talented developers making websites
            </h5>
            <a href="/">
              <button className="btn btn-outline-primary border-2 rounded-pill pt-2">
                Get Started
              </button>
            </a>
          </div>
          <div className="col-md-6 mx-auto">
            <img className="img-fluid" src={web} alt="logo" />
          </div>
        </div>
      </div>
    </>
  );
};

export default Home;
